Les traboules sont  des passages à travers des cours dimmeuble qui permettent de se rendre dune rue à une autre.
Il en existe de plusieurs types :
traboule directe : on voit la sortie dès lentrée ;
traboule en angle : traversant deux ou plusieurs bâtiments à langle de deux rues ;
traboule rayonnante : une cour au cur dun îlot dhabitations comportant plusieurs accès ;
traboules à détours.

À Lyon, on dénombre environs 500 traboules.

Sur ces 2 clichés, la plus remarquable et la plus longue du Vieux Lyon part du n°27 de la Rue du Boeuf. Elle permet de traverser quatre maisons pour rejoindre la rue Saint-Jean, au n°54.

